import React from 'react'
import {link} from 'react-router-dom'
const Menu = (props) => (
<nav id= 'menu'>
    <Link href='/'>
        Usuarios
    </Link>
    <Link href='/tareas' >
        Tareas
    </Link>
</nav>
);

export default Menu;
